"original": |2-
     This attribute indicates the number of Jobs that are "ahead" of this
     Job in the relative chronological order of expected time to complete
     (i.e., the current scheduled order).  For efficiency, it is only
     necessary to calculate this value when an operation is performed that
     requests this attribute.
"fixed": |-
  This attribute indicates the number of Jobs that are "ahead" of this Job in the relative chronological order of expected time to complete (i.e., the current scheduled order).  For efficiency, it is only necessary to calculate this value when an operation is performed that requests this attribute.
"ko": |-
  이 속성은 완료 예상 시간(예: 현재 예약된 순서)의 상대적 연대순 순서로 이 작업보다 '앞에' 있는 작업 수를 나타냅니다. 효율성을 위해 이 속성을 요청하는 작업이 수행될 때만 이 값을 계산하면 됩니다.
